// by deboershapes //

//set id
let id="00" 

//set delta
let delta=[0,0,0]
let delta00=.5*.75
let delta01=0
let delta02=0
delta=[delta00,delta01,delta02]

//find objects   drawer_handle  drawer_front drawer_sidea  drawer_sideb  drawer_base  drawer_back
let drawer_handle=parcel.getFeatureById('drawer_handle'+id)
let drawer_front=parcel.getFeatureById('drawer_front'+id)
let drawer_sidea=parcel.getFeatureById('drawer_sidea'+id)
let drawer_sideb=parcel.getFeatureById('drawer_sideb'+id)
let drawer_base=parcel.getFeatureById('drawer_base'+id)
let drawer_back=parcel.getFeatureById('drawer_back'+id)

//find drawer items
let drawer_stuffa=parcel.getFeatureById('drawer_stuffa'+id)




//define by closed positin using current position
let closed_position_drawer_handle=[drawer_handle.position.x, drawer_handle.position.y, drawer_handle.position.z]
let closed_position_drawer_front=[drawer_front.position.x, drawer_front.position.y, drawer_front.position.z]
let closed_position_drawer_sidea=[drawer_sidea.position.x, drawer_sidea.position.y, drawer_sidea.position.z]
let closed_position_drawer_sideb=[drawer_sideb.position.x, drawer_sideb.position.y, drawer_sideb.position.z]
let closed_position_drawer_base=[drawer_base.position.x, drawer_base.position.y, drawer_base.position.z]
let closed_position_drawer_back=[drawer_back.position.x, drawer_back.position.y, drawer_back.position.z]

//stuff  
let closed_position_drawer_stuffa=[drawer_stuffa.position.x, drawer_stuffa.position.y, drawer_stuffa.position.z]




//calculate open position
var open_position_drawer_handle=[closed_position_drawer_handle[0]+delta[0], closed_position_drawer_handle[1]+delta[1], closed_position_drawer_handle[2]+delta[2]] 
var open_position_drawer_front=[closed_position_drawer_front[0]+delta[0], closed_position_drawer_front[1]+delta[1], closed_position_drawer_front[2]+delta[2]] 
var open_position_drawer_sidea=[closed_position_drawer_sidea[0]+delta[0], closed_position_drawer_sidea[1]+delta[1], closed_position_drawer_sidea[2]+delta[2]] 
var open_position_drawer_sideb=[closed_position_drawer_sideb[0]+delta[0], closed_position_drawer_sideb[1]+delta[1], closed_position_drawer_sideb[2]+delta[2]] 
var open_position_drawer_base=[closed_position_drawer_base[0]+delta[0], closed_position_drawer_base[1]+delta[1], closed_position_drawer_base[2]+delta[2]] 
var open_position_drawer_back=[closed_position_drawer_back[0]+delta[0], closed_position_drawer_back[1]+delta[1], closed_position_drawer_back[2]+delta[2]] 

//stuff  
var open_position_drawer_stuffa=[closed_position_drawer_stuffa[0]+delta[0], closed_position_drawer_stuffa[1]+delta[1], closed_position_drawer_stuffa[2]+delta[2]] 




//start closed
let drawer_open=false

//define move functions
function open_drawer(){
  drawer_handle.position.set(open_position_drawer_handle[0], open_position_drawer_handle[1], open_position_drawer_handle[2]) 
  drawer_front.position.set(open_position_drawer_front[0], open_position_drawer_front[1], open_position_drawer_front[2]) 
  drawer_sidea.position.set(open_position_drawer_sidea[0], open_position_drawer_sidea[1], open_position_drawer_sidea[2]) 
  drawer_sideb.position.set(open_position_drawer_sideb[0], open_position_drawer_sideb[1], open_position_drawer_sideb[2]) 
  drawer_base.position.set(open_position_drawer_base[0], open_position_drawer_base[1], open_position_drawer_base[2]) 
  drawer_back.position.set(open_position_drawer_back[0], open_position_drawer_back[1], open_position_drawer_back[2]) 

  //stuff  
  drawer_stuffa.position.set(open_position_drawer_stuffa[0], open_position_drawer_stuffa[1], open_position_drawer_stuffa[2]) 



  drawer_open=true    
}
function close_drawer(){
  drawer_handle.position.set(closed_position_drawer_handle[0], closed_position_drawer_handle[1], closed_position_drawer_handle[2])
  drawer_front.position.set(closed_position_drawer_front[0], closed_position_drawer_front[1], closed_position_drawer_front[2])
  drawer_sidea.position.set(closed_position_drawer_sidea[0], closed_position_drawer_sidea[1], closed_position_drawer_sidea[2])
  drawer_sideb.position.set(closed_position_drawer_sideb[0], closed_position_drawer_sideb[1], closed_position_drawer_sideb[2])
  drawer_base.position.set(closed_position_drawer_base[0], closed_position_drawer_base[1], closed_position_drawer_base[2])
  drawer_back.position.set(closed_position_drawer_back[0], closed_position_drawer_back[1], closed_position_drawer_back[2])

  //stuff  
  drawer_stuffa.position.set(closed_position_drawer_stuffa[0], closed_position_drawer_stuffa[1], closed_position_drawer_stuffa[2])


  drawer_open=false  
}


close_drawer()


//toggle drawer
drawer_handle.on('click',e=>{
  console.log('click')
  if(drawer_open==false){
    //open door
    open_drawer()   
    }else{
    //close door 
    close_drawer() 
  }  
})

