let id="XX" 
let skin_axis="z"  //  x or z
let reverse_skin=1  //  1 or -1  reverse inside and outside skin
let reverse_open=-1  //  1 or -1  reverse open direction
let reverse_side=-1  //  1 or -1  reverse open side
let door_solid=true

let delta=[0,0,0]
let delta00=.8
let delta01=.03
if(skin_axis=="z"){
  delta=[delta00*reverse_open,0,delta01*reverse_side]
}else if(skin_axis=="x"){
  delta=[delta01*reverse_side,0,delta00*reverse_open]
}

//let door= parcel.getFeatureById('door'+id)a
//let door_front= parcel.getFeatureById('door'+id+'_outside')
//let door_back= parcel.getFeatureById('door'+id+'_inside')

let door= parcel.getFeatureById('door'+id)
let door_front= parcel.getFeatureById('door'+id+'_outside')
let door_back= parcel.getFeatureById('door'+id+'_inside')

//set door solid
door.set({'collidable': door_solid})

//define by position
//let closed_position=[4.75,16,5.75]
//let open_position=[5.55,16,5.77] 
//var delta=closed_position[0]-open_position[0]

//define by current position and end position
//let closed_position=[door.position.x, door.position.y, door.position.z]
//let open_position=[5.55,16,5.77] 
//var delta=closed_position[0]-open_position[0]

//define by current position and delta
let closed_position=[door.position.x, door.position.y, door.position.z]


var open_position=[closed_position[0]+delta[0], closed_position[1]+delta[1], closed_position[2]+delta[2]] 

//define skin positions
let delta_skin=.01

if(skin_axis=="x"){

  var open_position_front=[open_position[0]-delta_skin*reverse_skin, open_position[1], open_position[2]] 
  var open_position_back=[open_position[0]+delta_skin*reverse_skin, open_position[1], open_position[2]] 

  var closed_position_front=[closed_position[0]-delta_skin*reverse_skin, closed_position[1], closed_position[2]] 
  var closed_position_back=[closed_position[0]+delta_skin*reverse_skin, closed_position[1], closed_position[2]] 
}else if(skin_axis=="z"){

  var open_position_front=[open_position[0], open_position[1], open_position[2]-delta_skin*reverse_skin] 
  var open_position_back=[open_position[0], open_position[1], open_position[2]+delta_skin*reverse_skin] 

  var closed_position_front=[closed_position[0], closed_position[1], closed_position[2]-delta_skin*reverse_skin] 
  var closed_position_back=[closed_position[0], closed_position[1], closed_position[2]+delta_skin*reverse_skin] 
}





//start with door closed
let door_open=false
door.position.set(closed_position[0], closed_position[1], closed_position[2]) 
door_front.position.set(closed_position_front[0], closed_position_front[1], closed_position_front[2]) 
door_back.position.set(closed_position_back[0], closed_position_back[1], closed_position_back[2]) 

//toggle door from front 
door_front.on('click',e=>{
  if(door_open==false){
    //open door
    door.position.set(open_position[0], open_position[1], open_position[2]) 
    door_front.position.set(open_position_front[0], open_position_front[1], open_position_front[2]) 
    door_back.position.set(open_position_back[0], open_position_back[1], open_position_back[2]) 
    door_open=true    
    }else{
    //close door 
    door.position.set(closed_position[0], closed_position[1], closed_position[2])   
    door_front.position.set(closed_position_front[0], closed_position_front[1], closed_position_front[2]) 
    door_back.position.set(closed_position_back[0], closed_position_back[1], closed_position_back[2]) 
    door_open=false  
  }  
})


//toggle door from back 
door_back.on('click',e=>{
  if(door_open==false){
    //open door
    door.position.set(open_position[0], open_position[1], open_position[2]) 
    door_front.position.set(open_position_front[0], open_position_front[1], open_position_front[2]) 
    door_back.position.set(open_position_back[0], open_position_back[1], open_position_back[2]) 
    door_open=true    
    }else{
    //close door 
