feature.on('keys', e => {
  if(screen=="level01"){
    if (e.keys.left) {
      moving=true
      direction="left"
    }
    if (e.keys.right) {
      moving=true
      direction="right"
    }

    if (e.keys.down) {
      moving=true
      direction="down"
    }
    if (e.keys.up) {
      moving=true
      direction="up"
    }
    if(e.keys.a){
      if(moving==true){
        moving=false
      }else{
        //drop bananas
        let stuff_in_way=false
        for(let i=0; i<bananas.length; i++){
          //find picked up banana
          if(bananas[i].picked_up==true){
            //check for wall
            for(let j=0; j<walls.length; j++){
              let wall2check=walls[j]
              if (bananas[i].x>=wall2check.x && bananas[i].x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
                //banana in wall dont drop
                stuff_in_way=true
              }
            }
            //check for other bananas
            if(stuff_in_way==false){
              for(let k=0; k<bananas.length; k++){
                if(bananas[k].picked_up==false){
                  if(bananas[i].x==bananas[k].x && bananas[i].y==bananas[k].y){
                    //banana in the way
                    stuff_in_way=true
                  }
                }
              }
            }
            if(stuff_in_way==false){
              bananas[i].picked_up=false
              //check if banana is inside house
              bananas[i].in_house=false
              for(let h=0; h<houses.length; h++){
                let house2check=houses[h]
                if(bananas[i].x>=house2check.x+2 && bananas[i].x<=house2check.x+house2check.w-2){
                  if(bananas[i].y<=house2check.y-1 && bananas[i].y>=house2check.y+house2check.h+2){
                    bananas[i].in_house=true
                  }
                }
              }
              holding_item=false
            }
            stuff_in_way=false
          }
        }

      }
    }
    if(e.keys.b && e.keys.a && e.keys.left && e.keys.right && e.keys.up){
      moving=false
      reset_base()
    }
  }else if(screen=="base"){
    if(e.keys.a==true && e.keys.b==false){
      reset_level01()
    }
  }else if(screen=="end"){
    if(e.keys.b==true){
      reset_base()
    }
  }
})


