class Banana {
  constructor(x, y) {
    this.x=x
    this.y=y
    this.picked_up=false
    this.in_house=false
  }
  draw() {
      setDrawColorRGBA(255, 216, 0)
      drawRect(this.x, this.y, 1, 1);
  }
  update(){
    if(this.picked_up==true){
      switch(direction) {
        case "left":
          this.x=paddle.xPos-1
          this.y=paddle.yPos
        break;
        case "right":
          this.x=paddle.xPos+1
          this.y=paddle.yPos
        break;
        case "up":
          this.x=paddle.xPos
          this.y=paddle.yPos-1
        break;
        case "down":
          this.x=paddle.xPos
          this.y=paddle.yPos+1
        break;
      }

    }
  }
}






